  render(){
  return (
    <Router>
        <div className="row body">
            <div className="col-1"></div>
            <div className="col-10">
                <div className="row"> 
                    <div className="col-6"> 
                        <img src="http://localhost:4000/anh1"  alt="a"></img>
                    </div>
