                        <div className="row">
                            <div className="col-4"></div>
                            <div className="col-4"></div>
                            <div className="col-4">
                                
                            </div>
                        </div>
                        <i class="fas fa-shopping-cart size30">  
                            <div> Giỏ Hàng</div>
                            <div> 0đ </div>
                        </i>
                    </div>
                </div>
                <nav class="navbar navbar-light bg-light" ></nav>
            </div>
            <div className="col-1"></div>
        </div>

</Router>
    
  );
}}

export default Body;
